import React from 'react';
import ReactDOM from 'react-dom';
import Heading from './Heading';
import List from 'List';


ReactDOM.render(
    <>
    <Heading />

    <ol>
      <li>One</li>
      <li>Two</li>
      <li>Three</li>
    </ol>

    </>,

    document.getElementById('root')

);
